import Link from 'next/link';
import Navbar from '../components/Navbar';
import Sidebar from '../components/Sidebar';
import Content from '../components/Content';

const Index = () => (
    <>
        <div>
            <Navbar />
            <div className="columns">
                <Sidebar />
                <Content />
            </div>
        </div>
        <style jsx global>{`
            html, body, div {
                margin: 0;
                padding: 0;
                height: 100%;
            }

            div .columns {
                display: flex;
            }
        `}</style>
    </>
)

export default Index;
